import React from 'react';
import { Conteudo, Titulo, Paragrafo, Botao,AreaBotao } from "../inicio/estilo"



export default function Inicio() {
  return (
    <Conteudo  >

      <Titulo > ANSIEDADE O MAU DA SOCIEDADE </Titulo>

      <Paragrafo>

        Principais sintomas da ansiedade:enxergar perigo em tudo, apetite
        desregulado, alterações de sono,tensão muscular medo de falar em 
        publico,preocupações em excesso, ficar sempre perto de ataques de 
        nervos,medos irracionais, inquetação constante, sintomas ficios, 
        pensamentos obsessivos, percccionismo.

      </Paragrafo>

      <AreaBotao>

        <Botao>Se identificou?</Botao>

      </AreaBotao> 
    </Conteudo>
  );
}
